import React from 'react';
import {
  Form,
  Input,
  Button,
  Row,
  Col,
  DatePicker,
  Select,
  message
} from 'antd';
import { getItem } from 'Util/util';
import moment from 'moment';
import http from 'Util20/api';
const formItemLayout = {
  labelCol: { span: 4 },
  wrapperCol: { span: 16 }
};
const { TextArea } = Input;
const { Option } = Select;

/**
 * 补刷卡申请
 */

class CustomForm2 extends React.Component {
  state = {
    currentUser: JSON.parse(getItem('userInfo')).Data,
    currentTime: moment().format('YYYY-MM-DD HH:mm:ss'),
    submitting: false
  };
  componentDidMount() {
    let lan = localStorage.getItem('language');
    this.setState({lan});
  }
  handleSubmit = async e => {
    // e.preventDefault();
    this.setState({ submitting: true });
    this.props.form.validateFields(async (err, values) => {
      if (err) {
        return;
      }
      let { startTime, endTime, reason } = values;
      if (!startTime && !endTime) {
        return message.info(this.state.lan==='中文'?'至少选择上、下班时间中的一个':'Please Choose Start Time/End Time.');
      }
      try {
        let res = await http().addRecords({
          resid: '449440966625',
          data: [
            {
              C3_449349153817: 40, //项目编号
              C3_449663289150: reason, //事由
              C3_449349070185: startTime && startTime.format('YYYY-MM-DD'), //开始日期
              C3_449349087938: startTime && startTime.format('HH'), //开始小时
              C3_449349105582: startTime && startTime.format('mm'), //开始分钟
              C3_449349077689: endTime && endTime.format('YYYY-MM-DD'), //结束日期
              C3_449349100590: endTime && endTime.format('HH'), //结束小时
              C3_449349105691: endTime && endTime.format('mm'), //结束分钟
              C3_479576033832: startTime && 'Y',
              C3_479576038621: endTime && 'Y'
            }
          ],
          dblinkname: 'ehr'
        });
        message.success(res.message);
        this.props.goBack();
        this.props.getNotices();
        this.setState({ submitting: false });
      } catch (error) {
        console.log(error);
        message.error(error.message);
        this.setState({ submitting: false });
      } finally {
        this.setState({ submitting: false });
      }
    });
  };
  render() {
    const { getFieldDecorator } = this.props.form;
    const { currentUser,lan, currentTime, submitting } = this.state;
    const { showAllminuteShuaKa } = this.props;
    return (
      <div className="attendace-aplly_form__wrapper">
        <Form className="attendace-aplly_form">
          <h2>{lan==='中文'?'补刷卡申请单':'Mend Leaks Application'}</h2>
          <span style={{ background: 'yellow', fontSize: '1rem', fontWeight: 'bold' }}>
            {
              lan==='中文'?'注意：您在补刷卡时，除了选择日期以外，务必选择具体的几点几分。':'Caution:You must select date and time.'
            }
            
            </span>
          <br />
          <br />{
              lan==='中文'?<>
          <span style={{ color: '#f5222d', fontWeight: 'bold', fontSize: '1.2rem', lineHeight: '1.3rem', background: 'yellow' }}>※[</span><span style={{ fontSize: '1.3rem', lineHeight: '1.3rem', background: 'yellow', fontWeight: 'bold' }}>点击 "确定" 左边的</span><span style={{ fontSize: '2rem', color: '#1890ff', lineHeight: '1.3rem', background: 'yellow' }}>"选择时间"</span><span style={{ color: '#f5222d', fontSize: '1.5rem', lineHeight: '1.5rem', background: 'yellow', fontWeight: 'bold' }}>]</span>
          <br />
          <span style={{ color: '#f5222d', fontWeight: 'bold' }}>结果示例：<img style={{ width: '26rem' }} src="data:image/png;base64," /></span>
          <br />
          <span style={{ color: '#f5222d', fontSize: '1rem', fontWeight: 'bold' }}>若未选择具体时间点，默认的00点00分，将使这次补刷卡失败。</span>
          <br />
          <br /></>:null}
          <Row style={{ fontWeight: 600, marginBottom: 32 }}>
            <Col span={8}>{lan==='中文'?'填单人：':'Applicant:'}{currentUser}</Col>
            <Col span={16}>{lan==='中文'?'填单时间：':'Application Time'}{currentTime}</Col>
          </Row>

          <Form.Item
            {...formItemLayout}
            label={lan==='中文'?"上班时间：":'Start Time'}
            help={
              <span style={{ color: '#f22735' }}>
                {lan==='中文'?"选择上班时间即代表补上班卡点":"The time you go to work."}
              </span>
            }
          >
            {getFieldDecorator('startTime', {})(
              <DatePicker
                showTime={{
                  format: 'HH:mm',
                  minuteStep: showAllminuteShuaKa ? 1 : 30,
                  defaultValue: moment('00:00', 'HH:mm')
                }}
                format="YYYY-MM-DD HH:mm"
              />
            )}
          </Form.Item>

          <Form.Item
            {...formItemLayout}
            label={lan==='中文'?"下班时间：":'End time'}
            help={
              <span style={{ color: '#f22735' }}>
                {lan==='中文'?"选择下班时间即代表补下班卡点":"The time you go off work."}
              </span>
            }
          >
            {getFieldDecorator('endTime', {})(
              <DatePicker
                showTime={{
                  format: 'HH:mm',
                  minuteStep: showAllminuteShuaKa ? 1 : 30,
                  defaultValue: moment('00:00', 'HH:mm')
                }}
                format="YYYY-MM-DD HH:mm"
              />
            )}
          </Form.Item>

          <Form.Item {...formItemLayout} label={lan==='中文'?"事由：":'Reason'}>
            {getFieldDecorator('reason', {})(
              <TextArea placeholder={lan==='中文'?"请输入事由":"Input Reason"} />
            )}
          </Form.Item>

          <Row>
            <Button
              loading={submitting}
              type="primary"
              // htmlType="submit"
              onClick={() => {
                this.handleSubmit();
              }}
              style={{ marginRight: 8 }}
            >
              {lan==='中文'?"提交":"Submit"}
            </Button>
            <Button onClick={this.props.goBack}>{lan==='中文'?"返回":"Back"}</Button>
          </Row>
        </Form>
      </div>
    );
  }
}
export default Form.create({})(CustomForm2);
